import React from 'react'
// import magic from './Header.module.css'


const Header = () => {
  return (
    <div>
      <div className="top">
          <p> Order online or call us (1800) 000 8808 </p>
          <span>
              <img src="../assets/whishlist.png" alt="wishlist" />
          </span>
      </div>
    </div>
  )
}

export default Header;
